export const Results = ({ imagesList }) => {
    return (
        <div>
            {imagesList.map(image =>
                <div>
                    <img src={image.urlImage}  alt="Paris" width="150" height="300" />
                    <h3>{image.nameImage}</h3>

                </div>
            )}
        </div>
    )
}
